def rectangle_count(A: int) -> int:
    lim = int(math.sqrt(A))
    count = 1
    for i in range(1, lim + 1):
        if A % i == 0:
            t = A // i
            if i % 2 == 0 and t % 2 == 0:
                if i == t:
                    count += 1
            else:
